# SideWinder.AntiBot.Script

**blog.group-ib.com/sidewinder-antibot**

01.06.2022

Analysis of SideWinder's new infrastructure and tool that narrows their reach to Pakistan


-----

Nikita Rostovcev

Analyst at APT Research Team, Group-IB


-----

Alexander Badaev

Junior Analyst at APT Research Team, Group-IB

Group-IB Threat Intelligence researchers have discovered a new malicious infrastructure and a custom tool of the
APT group SideWinder (aka Rattlesnake, Hardcore Nationalist, RAZOR TIGER, T-APT-04 and APT-C-17), a threat
actor that is [believed to be originating from India and primarily targeting Pakistan. The newly discovered custom](https://attack.mitre.org/groups/G0121/)
**tool, codenamed SideWinder.AntiBot.Script, is being used in the gang’s phishing attack against Pakistani**
**targets. Group-IB Threat Intelligence team shares its findings so that security teams can more effectively identify**
SideWinder attacks.
**Key findings**

**Over the last year,** **[Group-IB Threat Intelligence system identified 92 IP addresses that have been used by](https://www.group-ib.com/products/threat-Intelligence-and-attribution/)**
**SideWinder APT for phishing emails.**
**Pakistan remains the primary target for SideWinder. The attackers are especially interested in the Pakistani**
**government organizations based on the discovered phishing document and public studies.**

**Phishing links in emails or posts that mimic legitimate notifications and services of government agencies**
**and organizations in Pakistan are primary attack vectors of the gang.**

**SideWinder started using an anti-bot script to filter their victims - they are only interested in Pakistani users.**


-----

**The group continues to distribute malicious files in ZIP archives with an LNK file inside, which downloads an**
**HTA file from a remote server.**

**Upon discovery, Group-IB Threat Intelligence team notified relevant local authorities and shared its findings**
**to make sure that the threat can be identified and contained at early stages. CERT-GIB also sent**
**notifications to dedicated computer emergency response teams in Pakistan.**

## SideWinder Profile

The SideWinder APT is believed to be an Indian nation-state threat actor. In their attacks, SideWinder was seen
targeting government, military, and economic sectors in Southeast Asia: in Afghanistan, Nepal, Sri Lanka, Bhutan,
Myanmar, the Philippines, Bangladesh, Singapore, and China. However, since the discovery of the group in 2012,
Pakistan has been the primary target of SideWinder. In the last year alone, several SideWinder’s attacks targeting
Pakistan have been detected. SideWinder was particularly interested in the Pakistani military targets.

[The Pakistani government even published an official advisory about SideWinder activity:](https://cabinet.gov.pk/SiteImage/Misc/files/NTISB%20Advisories/2019/22-Advisory-No-22-2019.pdf)

Image 1. Fragment of the official notification about SideWinder’s attacks


