## SideWinder Network Infrastructure

Over the last year, Group-IB’s Threat Intelligence solution detected 92 IP addresses used by SideWinder. The
servers were automatically detected by Group-IB and Threat Intelligence users immediately received a proactive
notification about the appearance of the new malicious infrastructure.

The analysis of the servers revealed that they were primarily used for phishing attacks. SideWinder’s phishing
attacks will be covered later in the text in more detail.

Below is a summary of 2.56.245[.]21, one of SideWinder’s servers. According to Group-IB data, the server has been
in use by SideWinder since at least January 22, 2022.


-----

Image 4: Network Indicators related to 2.56.245[.]21 Source: Group-IB Threat Intelligence

Thanks to Group-IB’s Network Graph Analysis tool, shown above, it was possible to discover that this address is
used as the A-record for the following domains:

finance.pakgov[.]net;
vpn.pakgov[.]net;
csd.pakgov[.]net;
hajj.pakgov[.]net;
nadra.pakgov[.]net;
pt.pakgov[.]net;
flix.pakgov[.]net;
covid.pakgov[.]net.

As you may have guessed, these are all phishing domains mimicking legitimate domains of Pakistani governmental
and non-governmental institutions, such as finance.gov.pk.


-----

Image 5. A fragment of the network infrastructure associated with the SideWinder group. Source: Group-IB Threat
Intelligence

### Phishing categorization

Each of the previously mentioned servers detected by Group-IB Threat Intelligence system mimic the public services
related to Pakistan. Some of them are:

While investigating these malicious domains, Group-IB researchers found a phishing link "vpn.pakgov[.]net/Download-3b00fd1a" - which redirects to a legitimate domain "securevpn.com". This may indicate
a temporary suspension of the malicious campaign or conversely the link could redirect to a malicious site in the
future as part of a different campaign.

Image 6. Screenshot with redirect to legitimate securevpn.com

Also among the discovered phishing links, Group-IB researchers found a link that downloaded an application from
[the official Google Play store called "SecureVPN"](https://web.archive.org/web/20220520104931/https://play.google.com/store/apps/details?id=com.securedata.vpn)


-----

Image 7. Screenshot from the Google Play store

The app in question looks suspicious: it has only 10+ downloads. It was published by the author, “ross jack”, with
[only one project. Furthermore, the description of the application was copied from NordVPN's description:](https://microsoftedge.microsoft.com/addons/detail/nordvpn-%E2%80%93-vpn-proxy-for-p/fphgeikpdcdcheaochkhldmnfblfogla)


-----

Image 8. Screenshot from the Microsoft Edge extension store

Therefore, Group-IB researchers assume that the application most likely mimics the legitimate Secure VPN
application of the same name. At runtime, this application performs the following requests:

hXXps://api.vpn-secure[.]co/secureVpn/;
hXXps://api.vpn-secure[.]co/secureVpn/register;

However, at the time of the research, they were unavailable, and a request to the root of the page redirects to the
legitimate NordVPN domain.


-----

Image 9. Request to the root of the api.vpn-secure[.]co

[In 2020, Trend Micro researchers found similar malicious apps that were attributed to the SideWinder group. These](https://www.trendmicro.com/en_us/research/20/a/first-active-attack-exploiting-cve-2019-2215-found-on-google-play-linked-to-sidewinder-apt-group.html)
apps were also uploaded to the Google Play Store. It is worth noting that at the time of writing we cannot confirm if
the Secure VPN app developed by "ross jack" is 100% malicious. This research is ongoing.

## Kill Chain

In this section we will take a closer look at the infection chain. As in previous SideWinder’s attacks, it all starts with a
phishing link:

Group-IB researchers also found malicious links posted on Facebook:


-----

Image 13. Screenshot of a malicious link on Facebook

Once the victim clicks on the link, an archive with a malicious .LNK file or RTF document is downloaded. In the case
of LNK, the files have a Microsoft Word icon, making it appear more legitimate, encouraging people to open.
Whether the initial vector was a phishing email or a phishing link posted on social media, the malicious payload is
always launched using the DLL side-loading technique, which provides persistence and has RAT functionality.

As soon as the recipient clicks on the link, the new tool, dubbed SideWinder.AntiBot.Script by Group-IB researchers,
comes into play. The script checks the client browser environment and, based on several parameters, decides
whether to issue a malicious file or redirect to a legitimate resource.

For example, let's take finance.pakgov[.]net which we have described a little already.
The phishing link appears as follows - hxxps://finance.pakgov[.]net/salary-a4222e91.
Let's first see what happens if we try to follow this link with settings different from a typical Pakistani user.

Image 14. Screenshot with hxxps://finance.pakgov[.]net/salary-a4222e91 request and redirect to legitimate
finance.gov.pk

As you can see in the screenshot above, when a client visits this link, which the anti-bot script does not like, the
script redirects to a legitimate document located on a legitimate resource: finance.gov.pk. And, the script won't even
work if the client's IP address differs from Pakistan's - the client will automatically be redirected to the legitimate
resource. These are common techniques that are used to avoid detection by threat researchers.


-----

Image 15. Redirect to a legitimate document.

However, if you follow a link with an IP address from Pakistan, the anti-bot script will work.


-----

Image 16. SideWinder.AntiBot.Script snippet (the full version of the script is available below in the list of indicators of
compromise)

To begin with, the CAPTCHA page immediately catches the eye. While the user is waiting, the client's browser is
profiled to give the final verdict.


-----

Image 17. Screenshot of fake CloudFlare page

If the client does not pass the anti-bot script filtering, for example, by the parameter of the operating system used,
then a corresponding message will be displayed.


-----

Image 18. Screenshot of the platform compatibility error.

### Detection of a client's browser environment

The script is written to collect everything it can reach to verify that the user is not a researcher or a security solution
attempting to detect malicious code:

Geo-position - check;

Image 19. A snippet of SideWinder.AntiBot.Script

Version of the operating system - check;
Data about the user agent - check;
System language settings - check;
The number of logical processors - check;
Accessing the [CredentialsContainer interface, which can return saved passwords from the browser if the](https://developer.mozilla.org/en-US/docs/Web/API/CredentialsContainer)
necessary function is called. (not used );


-----

Image 20. A snippet of SideWinder.AntiBot.Script

A feature that avoids automatic analysis using the Headless version of Chrome - check;


-----

Image 21. A snippet of SideWinder.AntiBot.Script

A list of possible video cards used and checking their compliance with the screen size. (Images 22 and 23):


-----

Image 24. A snippet of SideWinder.AntiBot.Script

Check for compliance with operating systems from the list:

Image 25. A snippet of SideWinder.AntiBot.Script

And most importantly, the function of issuing a malicious file and the function to redirect to a legitimate
resource.


-----

Image 26. A snippet of SideWinder.AntiBot.Script

However, in another script found on another malicious domain - finance.govpk-mail[.]net - the redirect function still
led to a link with a payload:

Image 27. A snippet of SideWinder.AntiBot.Script

