### Payload

In one case the downloadable file (SHA1- 4421f214c91a08ac0318871c6f918cfffe36d039) was an archive named
"Pay and Pension Increase Circular_Finance Division.zip"

The contents of this archive consist of files:

64a889e35b10a902170abe092c6c6b8f16c66dd1 - Pay and Pension Increase Circular_Finance
Division.pdf.lnk;
5e5e038453fde5ddf57820783dd9ce8f5f042df2 - ~wnotification002.tmp;
6a99ce5387c5b67602b2ef633bfbdc184e4d845c - ~wnotification003.tmp.

Image 30. Contents of "Pay and Pension Increase Circular_Finance Division.zip

"Pay and Pension Increase Circular_Finance Division.pdf.lnk" is a shortcut that contains a command to download
and execute the file hxxps://finance.govpkmail[.]net/15523/1/12443/2/0/0/1/1874254181/79DWxM3xhqvyZapU4oq7D3M8j5wB6f4HVHnbIEc/files60b6e42b/hta using MSHTA.

Image 31. Contents of "Pay and Pension Increase Circular_Finance Division.pdf.lnk

Unfortunately, the second stage of the payload turned out to be inactive, so we got a "404 Not Found" error.


-----

Image 32. Screenshot of the error receiving the second stage of the payload.

However, this attack is not unique to SideWinder. HTAs typically contain PowerShell, VBScript, or JavaScript, and
the latter has been seen more often in recent attacks.

HTAs are typically used to download files for later use by the DLL-sideloading technique. In some cases, HTAs also
upload a decoy document, usually in PDF format, to put the victim's attention down.

[The use of this technique by this group was mentioned publicly by researchers from Sangfor Qianlimu Security Lab.](https://mp.weixin.qq.com/s/Kkta59k7r81uIBjJvE9pCw)


-----

[Image 33. Fragment of Kill Chain taken from https://mp.weixin.qq.com/s/Kkta59k7r81uIBjJvE9pCw](https://mp.weixin.qq.com/s/Kkta59k7r81uIBjJvE9pCw)

When using this technique, HTA will load the "Duser.dll" file and copy the system file "credwiz.exe" into the same
directory. The "credwiz.exe" loads "Duser.dll" with the Dll Side-Loading technique, which in turn downloads and
executes the final backdoor. The final backdoor allows the attacker:

Collect system information;
Collect list of files and paths to them;
Collect selected files;
Update commands and C2 addresses.

## Conclusion

Given the SideWinder’s widespread activity deploying new command and control servers and the number of
observed phishing links, Group-IB Threat Intelligence team decided to publish these findings so that potential targets
in Pakistan identified as part of the research could check their networks and identify attacks by Sidewinder that are
in early stages. If you believe you may be a victim of similar phishing campaigns or that you may be one of the
attackers’ targets [please reach out.](https://www.group-ib.com/incident-response.html)
